import React from "react";
import "./background.css";
import topLeftCircle from "./bg-pattern-top.svg";
import bottomLeftCircle from "./bg-pattern-bottom.svg";

export const Background = () => {
  return (
    <div className="background">
      <div className="circle --top-left">
        <img src={topLeftCircle} alt="top left circle" />
      </div>
      <div className="circle --bottom-right">
        <img src={bottomLeftCircle} alt="bottom left circle" />
      </div>
    </div>
  );
};
